  console.log('character list', props);
  const html = props.data.map((characterData) => {
    <li key={props.data.id}>
      <a href=''></a>
      <img className='' src='' alt='' title='' />
      <h4 className=''>Nombre</h4>
      <p className=''>Especie</p>
    </li>;
  });
  return <ul>{html}</ul>;
}
export default CharacterList;
